import Hero from "./components/Hero";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PowerTool from './power/PowerTool';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Hero />} />
        <Route path="/power" element={<PowerTool />} />
      </Routes>
    </Router>
  );
};

export default App;
